import React from 'react';
import '../styles/about.css';
import ServiceList from '../services/ServiceList';
import {Container,Row,Col} from 'reactstrap';
const About = () => {
  return (
    <>
    <section className='about-section'>
    <Container>
    
      <Row>
        <Col>
        <h2>What we serve</h2>
        {/* <ServiceList/> */}
        </Col>
        
      </Row>
    </Container>
  </section>
    </>
  )
}

export default About
